import '../ComponentStyles/manage.css'

function Manage({ currentUser }) {
    return (
        currentUser ? <Authorized currentUser={currentUser} /> : <UnAuthorized />
    )
}

function UnAuthorized() {
    return (
        <div className="unauthorized-user">
            <h2>You are Not Allowed to Access This Page</h2>
        </div>
    )
}

function Authorized({currentUser}) {
    return (
        currentUser &&
        <div className="authorized-container">
            <div className="manage-title">
                <h3>Hello {currentUser.username}</h3>
                <p>This Page is Created to Help you Display Country Data Correctly</p>
            </div>
            <div className="manage-table">

            </div>
        </div>
    )
}

export default Manage;
